            <path d="M1.00015 1L8.99993 9.00002" stroke="#737F92" strokeWidth="2" strokeLinecap="round"/>
            <path d="M8.99988 1L1.0001 9.00002" stroke="#737F92" strokeWidth="2" strokeLinecap="round"/>
        </svg>

    );
};
